script: |
  super -f text -I q9500.spq | sort > q9500.out

inputs:
  - name: q9500.spq
    data: |
      SELECT DISTINCT + col1 AS col2, + 10 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT NULL IS NOT NULL AND NOT + col0 IS NULL;
  - name: tab2

outputs:
  - name: q9500.out
    data: |
      51	10
      67	10
      77	10
